import React from 'react';
import styled from "styled-components";
import {SectionTitle} from "../../../components/ScetionTitle";
import {Menu} from "../../../components/menu/Menu";
import {FlexWrapper} from '../../../components/FlexWrapper';
import {Work} from "./work/Work";
import socialImg from '../../../assets/img/Portfolio.png'
import {Container} from "../../../components/Container";
import {theme} from "../../../styles/Theme";
import akar from '../../../assets/img/akar-icons_arrow-left.svg'



export const Works = () => {
    return (
        <StyledWork>
            <SectionTitle padding={'100px 0 50px 0'}>Portfolio</SectionTitle>
            <Container>
                <FlexWrapper justify={'center'}>
                    <ButtonSlider/>
                    <Work title={'Landing Ice-cream'} src={socialImg} text={'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec ut orci eu elit consequat posuere ut sed elit. Nulla et tristique felis. Morbi quis orci non purus blandit fringilla. Etiam et mollis eros. Duis venenatis vulputate lacus, non tristique eros placerat vel. Nam nec magna lacus. Etiam euismod egestas mauris nec mollis. Phasellus efficitur et ex vel condimentum. Cras enim purus, tempor sed massa vel, accumsan bibendum magna. Nullam hendrerit cursus purus, sit amet viverra arcu gravida vel.'}/>
                </FlexWrapper>
            </Container>
        </StyledWork>
    );
};

const StyledWork = styled.section`
  padding-bottom: 150px;
`

type ButtonSliderPropsType = {
    margin?: string
}



const ButtonSlider = styled.button<ButtonSliderPropsType>`
  width: 60px;
  height: 60px;
  border-radius: 50%;
  background-color: ${theme.colors.additional};
  background-image: url(${akar});
  background-repeat: no-repeat;
  background-position: center;
  margin-top: 243px;
  margin-right: 40px;
  
  margin: ${props => props.margin};
`
